import React, { Component } from 'react';
import './ListOfProjs.css'

class ListOfProjs extends Component {
	
	constructor(props) {
		super(props);
		
		this.createProj = this.createProj.bind(this);
	}
	
	delProj = (key) => {
		//console.log(key);
		this.props.delElement(key);
	}
	
	createProj(proj) {
		//console.log(proj);
		return <li className='indJob' onClick={() => {this.delProj(proj.key)}} key={proj.key}>{proj.text}</li>
	}
	
	render() {
		 console.log(this.props.projs);
		let list = this.props.projs.map(this.createProj);
		
		return(
			<ul className='jobList'>
				{list}
			</ul>
		);
	}
}

export default ListOfProjs;
